syntax "proto3";

package aws;

message AwsEip {
  association_id = 1;
  domain = 2;
  id = 3;
  instance_id = 4;
  network_interface_id = 5;
  network_interface_owner_id = 6;
  private_dns = 7;
  private_ip = 8;
  public_dns = 9;
  public_ip = 10;
  public_ipv4_pool = 11;
  tags = 12;
  message Filter {
    name = 1;
    values = 2;
  }
  filter = 13;
}